%POSE2DSOLVER Refractive pose minimal solver, 2D case
%	v = POSE2DSOLVER(X,x,n1,n2) solves for the rotation and
%	translation parameters of a 2D camera moving in the xz-plane, observing points X projected
%	to x. The y-coordinates of X and x are assumed to be zero, and the refractive plane
%	is assumed to be z = 0.
%	n1 and n2 are the refractive indices of the camera- and point-side media respectively.
%	Solutions are returned in v = [cos(theta); sin(theta); tx; tz]
%
%	N = POSE2DSOLVER(...,'newton',k) refines the solutions with k Newton steps.
%
%	N = POSE2DSOLVER(...,'check_tol',tol) filters solutions with absolute tolerance tol.
function v = pose2dsolver(X,x,n1,n2,varargin)

newton_steps = 0;
check_tol = 1e-5;

for i=1:2:length(varargin)
	switch varargin{i}
		case 'newton', newton_steps = varargin{i+1};
		case 'check_tol', check_tol = varargin{i+1};
		otherwise, error('Parameter parse error');
	end
end

u = bsxfun(@rdivide,x,sqrt(sum(x.^2,1)));
nrat2 = (n1/n2)^2;

% Fill in equation matrix
coeff = eqcoeff(u,X,nrat2);
C = eqmat(coeff);


dE = 1397;
dR = 39;
dB = 48;
red_ia = 1:39;
red_ib = 1:39;
basis_ia = 40:48;
basis_ib = [12:17 30 31 40];

% Eliminate excessive monomials and solve for reduction monomials
[qc,r] = qr(C(:,1:dE),C(:,dE+1:end),0);
C2 = [r qc];

red = find(abs(C2(:,dE))>1e-12,1,'last')+1:size(C2,1);
CR2 = C2(red,dE+1:dE+dR);
CB2 = C2(red,dE+dR+1:end);
T = -(CR2\CB2);

% Construct action matrix
A = zeros(dB);
for r=1:length(red_ia)
	A(red_ia(r),:) = T(red_ib(r),:);
end
for r=1:length(basis_ia)
	A(basis_ia(r),basis_ib(r)) = 1;
end

[v,~] = eig(A);
v = v(:,7:end); % There are always 6 zero eigenvalues

% v = [c*s c^2 s^2 tx tz]
v = bsxfun(@rdivide,v([41 40 42 46 47],:),v(48,:)); % Divide by constant term

% Throw away obviously complex solutions and those where c^2 or s^2 are negative
v = real(v(:,max(abs(imag(v)))<1e-2 & v(2,:)>=0 & v(3,:)>=0));

% We know c>0 at the true solution, use sign of c*s to find sign of s
v = [sqrt(v(2,:)); sign(v(1,:)).*sqrt(v(3,:)); v(4:5,:)];

% Check in the equations
keep = true(1,size(v,2));
for i=1:size(v,2)
	if max(abs(solvedeq(u,X,nrat2,v(:,i))))>check_tol
		keep(i) = false;
	end
end
v = v(:,keep);

% Take a few Newton steps to refine solutions
if newton_steps
	keep = true(1,size(v,2));
	for i=1:size(v,2)
		for j=1:newton_steps
			[f J] = eqjacandfun(u,X,nrat2,v(:,i));
			v(:,i) = v(:,i) - J\f;
		end
		if max(abs(solvedeq(u,X,nrat2,v(:,i))))>check_tol
			keep(i) = false;
		end
	end
	v = v(:,keep);
end




